System-local resources are scoped, mutable resources that are only available in the system that created them. Their state persists between time steps, but not between distinct systems created using the same function, as they work off of the SystemId created at their time of registration. In typical use, system-local resources are created implicitly, through the use of a Local resource smart-pointer type on one of the function arguments in your system. If you had some reason to manually create or overwrite them, you could instead use .insert_local_resource . Local resources are a fairly niche tool: use them if you want to track state that will only ever be relevant to a single system that you need to persist across frames. The official example for Events show how you can use them to create anEventReader, which could persist across frames if not all events were processed in the available time. When you want to have many similar, but distinct systems, you can use system-local resources in combination with generics to get interesting specialization, as shown in this overly-complex Timer example: use bevy::prelude::*; // By defining a trait, we can ensure that all of our types
// have the required common functionality
trait MyTimer { fn access(&mut self) -> &mut Timer;
} struct SlowTimer(Timer);
struct FastTimer(Timer); impl Default for FastTimer { fn default() -> Self { FastTimer(Timer::from_seconds(0.3, true)) }
} impl Default for SlowTimer { fn default() -> Self { SlowTimer(Timer::from_seconds(2.0, true)) }
} impl MyTimer for FastTimer { fn access(&mut self) -> &mut Timer { &mut self.0 }
} impl MyTimer for SlowTimer { fn access(&mut self) -> &mut Timer { &mut self.0 }
} fn main() { App::build() .add_plugins(MinimalPlugins) // We can customize two otherwise identical systems by specifying its type .add_system(run_timer::<SlowTimer>.system()) // The timer resource in these two systems are distinct .add_system(run_timer::<FastTimer>.system()) .run();
} // System-local resources initialize their value with their
// The trait bounds are needed to ensure that any T we might provide will work
fn run_timer<T: Send + Sync + Default + 'static + MyTimer>(time: Res<Time>, mut timer: Local<T>) { if timer.access().tick(time.delta_seconds()).just_finished() { println!("The time is {:?}", *time); }
}

